import React from "react";
import Data from "../../Data";
import Slider from "react-slick";
// import "slick-carousel/slick/slick.css";
// import "slick-carousel/slick/slick-theme.css";
const Slide = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3
      };
  return (
    <div>
          <Slider {...settings}>
            <div className="flex">

            </div>
      {Data.map((a, b) => {
        return (
          <>
            <h1>{a.name}</h1>
            <h1>{a.class}</h1>
            <h1>{a.sdfd}</h1>
          </>
        );
      })}
      </Slider>
    </div>
  );
};

export default Slide;
